export interface HospitalDetail {
    /**
     * The type of hospital bill. For example, 131
     */
    billType?: string;
    /**
     * Short description of the bill type.
     */
    billTypeDescription?: string;
    /**
     * If the bill type is Inpatient, then this is the name of admitting or attending provider.
     */
    admittingProviderName?: string;
    /**
     * Admit type.
     */
    admitType?: string;
    /**
     * Statement from date.
     */
    statementFromDate?: string;
    /**
     * Statement to date.
     */
    statementToDate?: string;
    /**
     * The record number of the patient associated with the hospital claim.
     */
    medicalRecordNumber?: string;
}
